import React from "react";
import ProgressBar from "progress";

const ProgressBarNew = () => {
  const now = 60;
  const progressInstance = <ProgressBar now={now} label={`${now}%`} />;
  return <div>render(progressInstance);</div>;
};

export default ProgressBarNew;
